import React, { Component } from 'react';
import './App.css';
import Pokemon from './liste/Pokemons';
import Details from './liste/PokemonDetails'
import './liste/style.css'

class App extends Component {

    render() {
        let url=window.location.pathname;
        let button;

        if (url === "locahost:3000") {
            button = < Pokemon/>;
        } else {
            button = <Details/>;
        }


    return (
        <div className="App">
              <h2> Pokedex</h2>
            <br></br>
            {button}
        </div>
    );
  }
}

export default App;
